// src/components/MovieList.js
import React from 'react';

const MovieList = ({ movies }) => {
    return (
        <div>
            {movies.length > 0 ? (
                movies.map(movie => (
                    <div key={movie.id}>
                        <h3>{movie.title}</h3>
                        <p>Rating: {movie.vote_average}</p>
                    </div>
                ))
            ) : (
                <p>No movies found.</p>
            )}
        </div>
    );
};

export default MovieList;
